import { Container, NavDropdown, Navbar, Nav } from "react-bootstrap";
import logo from "../../Image/logo.svg";
import { Link } from "react-router-dom";

function Header() {
  return (
    <>
      <header>
        <nav>
          <Link to="">
            <img src={logo} alt="" />
          </Link>

          <Link to=""></Link>

          <Link to=""></Link>

          <Link to=""></Link>

          <Link to=""></Link>

          <Link to=""></Link>

          <Link to=""></Link>

          <Link to=""></Link>
        </nav>
      </header>
    </>
  );
}

export default Header;
